INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (54701, 15284, 'Amoxicillin', 'Diabetes Mellitus', 'High urine concentrations of ampicillin may result in false-positive reactions when testing for the presence of glucose in urine using Clinitest®, Benedict''s Solution or Fehling''s Solution.  Since this effect may also occur with amoxicillin, it is recommended that glucose tests based on enzymatic glucose oxidase reactions (such as Clinistix®) be used.', '2', '', 'DDInter', 0);
