INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (54723, 277, 'Amoxicillin', 'Kidney Diseases', 'Most beta-lactam antibiotics are eliminated by the kidney as unchanged drug and, in some cases, also as metabolites.  The serum concentrations of beta-lactam antibiotics and their metabolites may be increased and the half-lives prolonged in patients with impaired renal function.  Dosage adjustments may be necessary and modifications should be based on the degree of renal impairment as well as severity of infection in accordance with the individual product package labeling.  Renal function tests should be performed periodically during prolonged and/or high-dose therapy, since nephrotoxicity and alterations in renal function have occasionally been associated with the use of these drugs.', '2', '', 'DDInter', 0);
